import React from 'react'
import Badge from '@mui/material/Badge';
import Stack from '@mui/material/Stack';
const BodyLeft = () => {
  return (
    <div>
     <Stack spacing={2} direction="row" sx={{backgroundColor:"red",width:"350px" ,height:"60px",marginLeft:"240px" ,padd}}>
      <Badge >
        ererwt
      </Badge>
      <Badge >wertte
      </Badge>
    </Stack>
    </div>
  )
}

export default BodyLeft
